import React from 'react';

export default class Popular extends React.Component {
	state = {
		selectedLanguage: 'All',
		repos: {},
		error: null,
	}

	render() {
		return (
			<header className="app__header">
				<div className="logo__wrapper"><img src={process.env.PUBLIC_URL + '/images/cp24-logo.png'} /></div>
				<aside className="logo-aside">header aside</aside>
			</header>
		)
	}
}
